import React from "react";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import { AccessTime, AccountBox, MoreHoriz } from "@material-ui/icons";
import img1 from "./img1.png";
import { Link } from "react-router-dom";
import { Grid } from "@material-ui/core";
import { useDispatch, useSelector } from "react-redux";
import { addBook } from "./store/action";

function BookCard() {
  const styles = {
    image: {
      width: "100%",
      height: "100%",
    },
    justify: {
      direction: "column",
      justify: "center",
      spacing: 5,
    },
    cards: {
      width: "20%",
      height: "65%",
    },
    div_image: {
      padding: 10,

      height: "60%",
      backgroundColor: "black",
    },
    horiz: {
      float: "right",
    },
  };
  const dispatch = useDispatch();
  dispatch(
    addBook({
      name: "HARRY POTTER",
      author: "VIVEK",
    })
  );

  const state = useSelector((state) => state.books);

  return (
    <Card style={styles.cards}>
      <div style={styles.div_image}>
        <img style={styles.image} alt=" " src={img1}></img>
      </div>
      <Grid container style={styles.justify}>
        <Grid item style={{ paddingLeft: "6%" }}>
          <Typography>
            <b>HARRY POTTER ALSo NEW SEASON JUYT </b>
          </Typography>
        </Grid>
        <Grid item style={{ paddingLeft: "6%" }}>
          <Typography noWrap={true} component="p">
            Vivek Reddy S
          </Typography>
        </Grid>
        <Grid item>
          <IconButton>
            <AccessTime />
          </IconButton>
          15 min to read
          <IconButton>
            <AccountBox />
          </IconButton>
          15.6k read
        </Grid>
        <Grid item style={{ padding: "4%" }}>
          <IconButton>
            <Link to="/book">
              <MoreHoriz />
            </Link>
          </IconButton>
        </Grid>
      </Grid>
    </Card>
  );
}

export default BookCard;
